import{_ as t,c as o,o as a,aj as l,bI as i}from"./chunks/framework.DRmbE9yB.js";const p=JSON.parse('{"title":"Excel Template","description":"","frontmatter":{"prev":{"text":"Site","link":"/documentation/site/site"},"next":{"text":"Scraper Data","link":"/documentation/site/site-scraper-data"}},"headers":[],"relativePath":"documentation/site/site-excel-template.md","filePath":"documentation/site/site-excel-template.md","lastUpdated":1758109585000}'),n={name:"documentation/site/site-excel-template.md"};function r(s,e,c,h,d,u){return a(),o("div",null,[...e[0]||(e[0]=[l('<h1 id="excel-template" tabindex="-1">Excel Template <a class="header-anchor" href="#excel-template" aria-label="Permalink to ‚ÄúExcel Template‚Äù">‚Äã</a></h1><p>Manage your Excel data source for automated form filling with support for both uploaded Excel files and Google Sheets integration.</p><img src="'+i+`" width="350" height="350" alt="Download Excel Template Interface"><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to ‚ÄúOverview‚Äù">‚Äã</a></h2><p>Excel templates serve as the data source for your automation workflows. The extension supports two types of Excel sheet integration:</p><ul><li><strong>üì§ Upload Excel Sheet</strong> - Upload local Excel (.xlsx) files</li><li><strong>üìä Google Sheet (Beta)</strong> - Connect to Google Sheets for real-time data access</li></ul><h2 id="excel-sheet-type-selection" tabindex="-1">Excel Sheet Type Selection <a class="header-anchor" href="#excel-sheet-type-selection" aria-label="Permalink to ‚ÄúExcel Sheet Type Selection‚Äù">‚Äã</a></h2><p>Choose between two methods for managing your Excel data:</p><h3 id="üì§-upload-excel-sheet" tabindex="-1">üì§ Upload Excel Sheet <a class="header-anchor" href="#üì§-upload-excel-sheet" aria-label="Permalink to ‚Äúüì§ Upload Excel Sheet‚Äù">‚Äã</a></h3><p>Upload local Excel files directly to the extension.</p><p><strong>Features:</strong></p><ul><li>Upload .xlsx files from your computer</li><li>Download template based on your form fields</li><li>Delete uploaded Excel file</li><li>Offline data access</li></ul><h3 id="üìä-google-sheet-beta" tabindex="-1">üìä Google Sheet (Beta) <a class="header-anchor" href="#üìä-google-sheet-beta" aria-label="Permalink to ‚Äúüìä Google Sheet (Beta)‚Äù">‚Äã</a></h3><p>Connect to Google Sheets for cloud-based data management.</p><p><strong>Features:</strong></p><ul><li>Real-time data synchronization</li><li>Two connection types: OAuth2 and Service Account</li><li>Multi-browser support with Browser ID</li><li>Automatic sheet updates</li><li>Cloud-based data storage</li></ul><hr><h2 id="method-1-upload-excel-sheet" tabindex="-1">Method 1: Upload Excel Sheet <a class="header-anchor" href="#method-1-upload-excel-sheet" aria-label="Permalink to ‚ÄúMethod 1: Upload Excel Sheet‚Äù">‚Äã</a></h2><h3 id="step-1-select-excel-sheet-type" tabindex="-1">Step 1: Select Excel Sheet Type <a class="header-anchor" href="#step-1-select-excel-sheet-type" aria-label="Permalink to ‚ÄúStep 1: Select Excel Sheet Type‚Äù">‚Äã</a></h3><ol><li>Navigate to <strong>Upload Excel</strong> tab</li><li>Select <strong>Upload Excel Sheet</strong> radio button</li></ol><h3 id="step-2-upload-excel-file" tabindex="-1">Step 2: Upload Excel File <a class="header-anchor" href="#step-2-upload-excel-file" aria-label="Permalink to ‚ÄúStep 2: Upload Excel File‚Äù">‚Äã</a></h3><p><strong>Select excel (.xlsx) file for Upload:</strong></p><ol><li>Click <strong>&quot;Choose File&quot;</strong> button</li><li>Select your Excel file (.xlsx format)</li><li>File will be uploaded automatically</li></ol><p><strong>Available Actions:</strong></p><table tabindex="0"><thead><tr><th>Button</th><th>Description</th></tr></thead><tbody><tr><td><strong>üì• Download Excel Template</strong></td><td>Download template with your form field structure</td></tr><tr><td><strong>üóëÔ∏è Delete Excel</strong></td><td>Remove the currently uploaded Excel file</td></tr></tbody></table><h3 id="step-3-excel-data-status" tabindex="-1">Step 3: Excel Data Status <a class="header-anchor" href="#step-3-excel-data-status" aria-label="Permalink to ‚ÄúStep 3: Excel Data Status‚Äù">‚Äã</a></h3><p><strong>When No Excel File is Uploaded:</strong></p><p>The interface will display:</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Not Found</span></span>
<span class="line"><span>Excel Data Not Available, Please Upload Excel File.</span></span></code></pre></div><p><strong>When Excel File is Uploaded:</strong></p><ul><li>Excel data becomes available for form filling</li><li>Data can be viewed in the <strong>Excel Data</strong> tab</li><li>Form filling can begin using the uploaded data</li></ul><hr><h2 id="method-2-google-sheet-beta" tabindex="-1">Method 2: Google Sheet (Beta) <a class="header-anchor" href="#method-2-google-sheet-beta" aria-label="Permalink to ‚ÄúMethod 2: Google Sheet (Beta)‚Äù">‚Äã</a></h2><h3 id="connection-types" tabindex="-1">Connection Types <a class="header-anchor" href="#connection-types" aria-label="Permalink to ‚ÄúConnection Types‚Äù">‚Äã</a></h3><p>Google Sheet integration offers two connection methods:</p><h4 id="üîê-oauth2-login-required" tabindex="-1">üîê OAuth2 (Login Required) <a class="header-anchor" href="#üîê-oauth2-login-required" aria-label="Permalink to ‚Äúüîê OAuth2 (Login Required)‚Äù">‚Äã</a></h4><p>Connect using your Google account with OAuth2 authentication.</p><p><strong>Requirements:</strong></p><ul><li>Google account login</li><li>Permission to access Google Sheets</li><li>Internet connection</li></ul><p><strong>Setup:</strong></p><ol><li>Select <strong>Google Sheet (Beta)</strong> radio button</li><li>Choose <strong>OAuth2 (Login Required)</strong> connection type</li><li>Click <strong>&quot;Check Account Connection&quot;</strong> to authenticate</li><li>Sign in with your Google account</li><li>Grant necessary permissions</li></ol><h4 id="üîë-client-service-account-no-login-required" tabindex="-1">üîë Client (Service Account, No Login Required) <a class="header-anchor" href="#üîë-client-service-account-no-login-required" aria-label="Permalink to ‚Äúüîë Client (Service Account, No Login Required)‚Äù">‚Äã</a></h4><p>Connect using a Google Cloud service account without login.</p><p><strong>Requirements:</strong></p><ul><li>Google Cloud Console service account</li><li>JSON key file (private_key, client_email)</li><li>Sheet shared with service account email</li></ul><p><strong>Setup:</strong></p><ol><li>Select <strong>Google Sheet (Beta)</strong> radio button</li><li>Choose <strong>Client (Service Account, No Login Required)</strong> connection type</li><li>Click <strong>&quot;Click to Upload JSON File&quot;</strong> button</li><li>Upload your service account JSON key file</li></ol><div class="tip custom-block"><p class="custom-block-title">Create Service Account</p><p>Create a service account in <strong>Google Cloud Console</strong>, download JSON key file (private_key, client_email), share the sheet with the service account email.</p></div><hr><h2 id="google-sheet-configuration" tabindex="-1">Google Sheet Configuration <a class="header-anchor" href="#google-sheet-configuration" aria-label="Permalink to ‚ÄúGoogle Sheet Configuration‚Äù">‚Äã</a></h2><h3 id="required-fields" tabindex="-1">Required Fields <a class="header-anchor" href="#required-fields" aria-label="Permalink to ‚ÄúRequired Fields‚Äù">‚Äã</a></h3><table tabindex="0"><thead><tr><th>Field</th><th>Description</th><th>Example</th></tr></thead><tbody><tr><td><strong>Spreadsheet URL</strong></td><td>Full URL of your Google Sheet</td><td><code>https://docs.google.com/spreadsheets/d/1A2B3C4D5E6F7G8H9I0...</code></td></tr><tr><td><strong>Spreadsheet Sheet Name (Sheet1)</strong></td><td>Name of the specific sheet tab</td><td><code>Sheet1</code>, <code>Data</code>, <code>FormData</code></td></tr><tr><td><strong>How many rows of the sheet to fetch?</strong></td><td>Number of rows to retrieve</td><td><code>30</code>, <code>50</code>, <code>100</code></td></tr></tbody></table><h3 id="optional-features" tabindex="-1">Optional Features <a class="header-anchor" href="#optional-features" aria-label="Permalink to ‚ÄúOptional Features‚Äù">‚Äã</a></h3><h4 id="üÜî-fetch-sheet-row-data-using-browser-id" tabindex="-1">üÜî Fetch Sheet Row Data Using Browser Id <a class="header-anchor" href="#üÜî-fetch-sheet-row-data-using-browser-id" aria-label="Permalink to ‚ÄúüÜî Fetch Sheet Row Data Using Browser Id‚Äù">‚Äã</a></h4><p>Enable this option to use different data for different browsers.</p><p><strong>How it works:</strong></p><ol><li>Toggle <strong>&quot;Fetch Sheet Row Data Using Browser Id&quot;</strong> checkbox</li><li>Enter browser ID names in the input field</li><li>Create a column named <code>{BROWSER-ID}</code> in your sheet</li><li>Fill browser ID names in this column</li></ol><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Browser IDs: browser-1, browser-2, browser-3</span></span></code></pre></div><div class="info custom-block"><p class="custom-block-title">Use Browser ID</p><p>Use Browser ID if you use same sheet in multiple browser, create a new column with this name <strong>{BROWSER-ID}</strong> and fill the browser id name in this column.</p></div><h4 id="üö´-ignore-column-values-when-updating" tabindex="-1">üö´ Ignore Column Values When Updating <a class="header-anchor" href="#üö´-ignore-column-values-when-updating" aria-label="Permalink to ‚Äúüö´ Ignore Column Values When Updating‚Äù">‚Äã</a></h4><p>Prevent specific columns from being updated when syncing data.</p><p><strong>How to use:</strong></p><ol><li>Toggle <strong>&quot;Ignore column values when updating the sheet?&quot;</strong> checkbox</li><li>Enter column names to ignore (press Enter after each)</li><li>These columns will be excluded from updates</li></ol><p><strong>Example:</strong></p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>title, description, notes</span></span></code></pre></div><hr><h2 id="google-sheet-actions" tabindex="-1">Google Sheet Actions <a class="header-anchor" href="#google-sheet-actions" aria-label="Permalink to ‚ÄúGoogle Sheet Actions‚Äù">‚Äã</a></h2><h3 id="üîç-check-account-connection" tabindex="-1">üîç Check Account Connection <a class="header-anchor" href="#üîç-check-account-connection" aria-label="Permalink to ‚Äúüîç Check Account Connection‚Äù">‚Äã</a></h3><p>Verify your Google account authentication status.</p><p><strong>For OAuth2:</strong></p><ul><li>Click <strong>&quot;Check Account Connection&quot;</strong> button</li><li>Sign in if not already authenticated</li><li>Verify connection status</li></ul><p><strong>For Service Account:</strong></p><ul><li>Upload JSON key file first</li><li>Click <strong>&quot;Check Account Connection&quot;</strong> button</li><li>Verify service account credentials</li></ul><h3 id="üìä-check-sheet-connection" tabindex="-1">üìä Check Sheet Connection <a class="header-anchor" href="#üìä-check-sheet-connection" aria-label="Permalink to ‚Äúüìä Check Sheet Connection‚Äù">‚Äã</a></h3><p>Verify connection to your Google Spreadsheet.</p><p><strong>Steps:</strong></p><ol><li>Enter Spreadsheet URL</li><li>Enter Sheet Name</li><li>Click <strong>&quot;Check Sheet Connection&quot;</strong> button</li><li>Verify sheet access and data availability</li></ol><h3 id="üì§-update-sheet-with-site-data" tabindex="-1">üì§ Update Sheet With Site Data <a class="header-anchor" href="#üì§-update-sheet-with-site-data" aria-label="Permalink to ‚Äúüì§ Update Sheet With Site Data‚Äù">‚Äã</a></h3><p>Sync your form field structure with Google Sheet.</p><p><strong>Purpose:</strong> For updating google sheet with your extension site data. this will insert columns and create database sheet.</p><p><strong>How it works:</strong></p><ol><li>Click <strong>&quot;Update Sheet With Site Data&quot;</strong> button</li><li>Extension reads your form field configuration</li><li>Creates/updates columns in Google Sheet</li><li>Generates database structure based on field types</li></ol><p><strong>What gets updated:</strong></p><ul><li>Column headers matching field names</li><li>Data validation rules</li><li>Field type formatting</li><li>Required field indicators</li></ul><h3 id="üóëÔ∏è-clear-sheet-cache" tabindex="-1">üóëÔ∏è Clear Sheet Cache <a class="header-anchor" href="#üóëÔ∏è-clear-sheet-cache" aria-label="Permalink to ‚ÄúüóëÔ∏è Clear Sheet Cache‚Äù">‚Äã</a></h3><p>Clear cached Google Sheet data to fetch fresh data.</p><p><strong>When to use:</strong> If you have changed any data in the sheet or added new columns, it is essential to clear the cache before using the sheet.</p><p><strong>Steps:</strong></p><ol><li>Click <strong>&quot;Clear Sheet Cache&quot;</strong> button</li><li>Cache will be cleared immediately</li><li>Next data fetch will retrieve fresh data from Google Sheet</li></ol><hr><h2 id="excel-template-download" tabindex="-1">Excel Template Download <a class="header-anchor" href="#excel-template-download" aria-label="Permalink to ‚ÄúExcel Template Download‚Äù">‚Äã</a></h2><h3 id="üì•-download-excel-template" tabindex="-1">üì• Download Excel Template <a class="header-anchor" href="#üì•-download-excel-template" aria-label="Permalink to ‚Äúüì• Download Excel Template‚Äù">‚Äã</a></h3><p>Generate and download an Excel template based on your form fields.</p><p><strong>How it works:</strong></p><ol><li>Click <strong>&quot;Download Excel Template&quot;</strong> button</li><li>Extension generates template with: <ul><li>Column headers matching field names</li><li>Sample data for guidance</li><li>Proper formatting for each field type</li></ul></li><li>File downloads to your default download folder</li></ol><p><strong>File naming:</strong> <code>[SiteName]_Template_[Date].xlsx</code></p><hr><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to ‚ÄúPrerequisites‚Äù">‚Äã</a></h2><p>Before using Excel templates, ensure you have:</p><ol><li><strong>‚úÖ Site Created</strong> - A site must be set up in the extension</li><li><strong>‚úÖ Form Added</strong> - At least one form must be added to the site</li><li><strong>‚úÖ Fields Configured</strong> - Form fields must be properly configured</li><li><strong>‚úÖ Field Types Set</strong> - Each field must have a defined field type</li></ol><hr><h2 id="workflow-integration" tabindex="-1">Workflow Integration <a class="header-anchor" href="#workflow-integration" aria-label="Permalink to ‚ÄúWorkflow Integration‚Äù">‚Äã</a></h2><h3 id="upload-excel-sheet-workflow" tabindex="-1">Upload Excel Sheet Workflow <a class="header-anchor" href="#upload-excel-sheet-workflow" aria-label="Permalink to ‚ÄúUpload Excel Sheet Workflow‚Äù">‚Äã</a></h3><ol><li><strong>Download Template</strong> - Get the latest template structure</li><li><strong>Fill Data</strong> - Enter your data in Excel</li><li><strong>Upload File</strong> - Upload the filled Excel file</li><li><strong>Run Automation</strong> - Execute automated form filling</li></ol><h3 id="google-sheet-workflow" tabindex="-1">Google Sheet Workflow <a class="header-anchor" href="#google-sheet-workflow" aria-label="Permalink to ‚ÄúGoogle Sheet Workflow‚Äù">‚Äã</a></h3><ol><li><strong>Connect Account</strong> - Authenticate with Google</li><li><strong>Configure Sheet</strong> - Set spreadsheet URL and sheet name</li><li><strong>Update Structure</strong> - Sync form fields with sheet columns</li><li><strong>Fill Data</strong> - Enter data in Google Sheet</li><li><strong>Run Automation</strong> - Execute automated form filling</li><li><strong>Clear Cache</strong> - Clear cache when data changes</li></ol><hr><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to ‚ÄúTroubleshooting‚Äù">‚Äã</a></h2><h3 id="upload-excel-sheet-issues" tabindex="-1">Upload Excel Sheet Issues <a class="header-anchor" href="#upload-excel-sheet-issues" aria-label="Permalink to ‚ÄúUpload Excel Sheet Issues‚Äù">‚Äã</a></h3><p><strong>Issue:</strong> Template not downloading</p><p><strong>Solutions:</strong></p><ul><li>Ensure all form fields are properly configured</li><li>Check if the site has at least one form</li><li>Verify browser download permissions</li><li>Try refreshing the extension options page</li></ul><p><strong>Issue:</strong> Excel file not uploading</p><p><strong>Solutions:</strong></p><ul><li>Verify file format is .xlsx</li><li>Check file size is reasonable</li><li>Ensure file is not corrupted</li><li>Try a different Excel file</li></ul><hr><h3 id="google-sheet-issues" tabindex="-1">Google Sheet Issues <a class="header-anchor" href="#google-sheet-issues" aria-label="Permalink to ‚ÄúGoogle Sheet Issues‚Äù">‚Äã</a></h3><p><strong>Issue:</strong> Cannot connect to Google account</p><p><strong>Solutions:</strong></p><ul><li>Check internet connection</li><li>Verify Google account credentials</li><li>Clear browser cache and cookies</li><li>Try re-authenticating</li></ul><p><strong>Issue:</strong> Sheet connection failed</p><p><strong>Solutions:</strong></p><ul><li>Verify spreadsheet URL is correct</li><li>Check sheet name matches exactly (case-sensitive)</li><li>Ensure sheet is shared with service account (for Client connection)</li><li>Verify permissions are granted</li></ul><p><strong>Issue:</strong> Data not updating</p><p><strong>Solutions:</strong></p><ul><li>Click &quot;Clear Sheet Cache&quot; button</li><li>Verify sheet has data in correct format</li><li>Check column names match field names</li><li>Ensure row count is set correctly</li></ul><p><strong>Issue:</strong> Browser ID not working</p><p><strong>Solutions:</strong></p><ul><li>Verify <code>{BROWSER-ID}</code> column exists in sheet</li><li>Check browser ID names are entered correctly</li><li>Ensure browser ID values match in sheet</li><li>Clear cache and try again</li></ul><hr><h2 id="best-practices" tabindex="-1">Best Practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to ‚ÄúBest Practices‚Äù">‚Äã</a></h2><h3 id="‚úÖ-do-s" tabindex="-1">‚úÖ Do&#39;s <a class="header-anchor" href="#‚úÖ-do-s" aria-label="Permalink to ‚Äú‚úÖ Do&#39;s‚Äù">‚Äã</a></h3><ul><li><strong>Use descriptive sheet names</strong> - Make sheet names clear and meaningful</li><li><strong>Keep data organized</strong> - Maintain consistent data formatting</li><li><strong>Regular backups</strong> - Backup your Excel files and Google Sheets</li><li><strong>Clear cache after changes</strong> - Always clear cache when updating Google Sheets</li><li><strong>Test with small datasets</strong> - Verify automation works before bulk processing</li><li><strong>Use Browser ID for multi-browser</strong> - Implement Browser ID when using same sheet across browsers</li></ul><h3 id="‚ùå-don-ts" tabindex="-1">‚ùå Don&#39;ts <a class="header-anchor" href="#‚ùå-don-ts" aria-label="Permalink to ‚Äú‚ùå Don&#39;ts‚Äù">‚Äã</a></h3><ul><li><strong>Don&#39;t modify column headers</strong> - Keep column names matching field names</li><li><strong>Don&#39;t use special characters</strong> - Avoid special characters in sheet names</li><li><strong>Don&#39;t forget to clear cache</strong> - Always clear cache after Google Sheet updates</li><li><strong>Don&#39;t share sensitive data</strong> - Be cautious with service account credentials</li><li><strong>Don&#39;t exceed row limits</strong> - Keep row count reasonable for performance</li></ul><hr><h2 id="related-documentation" tabindex="-1">Related Documentation <a class="header-anchor" href="#related-documentation" aria-label="Permalink to ‚ÄúRelated Documentation‚Äù">‚Äã</a></h2><ul><li><a href="/documentation/site/site.html">Site Management</a></li><li><a href="/documentation/site/site-excel-template.html">Excel Data</a></li><li><a href="/documentation/form-fields/field.html">Form Fields</a></li><li><a href="/documentation/form-fields/field-types.html">Field Types</a></li><li><a href="/documentation/services/google-service.html">Google Service</a></li><li><a href="/documentation/structure.html">Automation Workflow</a></li></ul><hr><h2 id="support-and-help" tabindex="-1">Support and Help <a class="header-anchor" href="#support-and-help" aria-label="Permalink to ‚ÄúSupport and Help‚Äù">‚Äã</a></h2><p>If you need assistance with Excel templates:</p><ul><li>Check the <a href="/documentation/log.html">Log</a> for detailed error information</li><li>Review <a href="/documentation/form-fields/field-types.html">Field Types</a> for configuration help</li><li>Visit our <a href="/documentation/#need-help">Support Channels</a> for community assistance</li><li>Report issues on our <a href="https://github.com/jeevan-lal/excellent-data-filler-docs/issues" target="_blank" rel="noreferrer">GitHub Repository</a></li></ul>`,143)])])}const m=t(n,[["render",r]]);export{p as __pageData,m as default};
